import { Title, List, Item, Btn } from "./Feedback.styled";

export const Feedback = () => {
  return (
    <>
      <Title>Please leave feedback</Title>
      <List>
        <Item>
          <Btn>Good</Btn>
        </Item>
        <Item>
          <Btn>Neutral</Btn>
        </Item>
        <Item>
          <Btn>Bad</Btn>
        </Item>
      </List>
    </>
  );
};
